export default function FilterButton (toggleModalVisibility) {
    function clickHandler(toggleModalVisibility) {
        toggleModalVisibility = true;
    }
    
    return(
        <button className="filter-button" onClick={clickHandler}>
            Filter and Sort
        </button>
    )
}
